import React, { Component } from 'react'
import AdminForm from './AdminForm'
import './Admin.css'

class Admin extends Component {
  render () {
    const form = Object.keys(this.props.data.contact).map(key => (
      <AdminForm key={key} data={this.props.data.contact[key]} />
    ))
    return (
      <div className='app'>
        <header className='appadmin'>
          <h1 className='appadmin'>Administration</h1>
        </header>
        {form}
      </div>
    )
  }
}
export default Admin
